import React, { Component } from 'react';
import './Profil.css'

class MyProfil extends Component {
    render () {
        return (
            <div className="PageProfil" style={{height: '100vh'}}>

                <div style={{height: '10%', width:'100%', backgroundColor:'red', marginTop:'0'}}>
                    <ul style={{margin}}>
                        <li>Mes informations</li>
                        <li>Mes commandes</li>
                        <li>Ma Liste</li>
                    </ul>
                </div>
            </div>
        );
    };
};

export default MyProfil;
